import React from 'react';



const table = () => {
  const [data, setData] = React.useState([]);
   React.useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((data) => {

        setData(data)
      });
  }
    , []);
  return (
    <div>
            {data.map((d, index) =>
              <div class="listing-item">
              <figure class="image">
                <img src="https://i.ytimg.com/vi/MTrzTABzLfY/maxresdefault.jpg" alt="image"/>
                  <figcaption>
                    <div class="caption">
                      <h1>$10000</h1>
                      <p>lorem</p>
                    </div>
                  </figcaption>
              </figure>
              <div class="listing">
                <h4>{d.name}</h4>
                <h4>Email signatures and banners</h4>
                <h4>E-invitations</h4>
                <h4>Online brochures</h4>
              </div>
            </div>
         

         )}

    </div>
  )
}

export default table
